// Check if public key exists
const publicKey = process.env.REACT_APP_PAYSTACK_PUBLIC_KEY;
if (!publicKey) {
  console.warn('Paystack public key is not set. Please set REACT_APP_PAYSTACK_PUBLIC_KEY in your .env file');
}

export const PAYSTACK_CONFIG = {
  publicKey: publicKey || 'pk_test_your_default_key_here', // Replace with your default test key
  currency: "GHS",
  channels: ["card", "bank", "mobile_money"],
  validatePayment: true,
};
